const loaded = () => {
    return {
        type: 'LOADED'
    }
}

const someErorr = (bool) => {
    return {
        type: 'ERROR',
        payload: bool
    }
}

const logout = () => {
    return {
        type: 'LOGOUT'
    }
}

const addUser = (user) => {
    return {
        type: 'NEW_USER',
        payload: user
    }

}

const getAllUsers = (allUsers) => {
    return {
        type: 'ALL_USERS',
        payload: allUsers
    }
}

const removeUser = (action) => {
    return {
        type: 'DELETE_USER',
        payload: action
    }
}

const posts = (posts) => {
    return {
        type: 'ALL_POSTS',
        payload: posts
    }
}

const setPost = (post) => {
    return {
        type: 'POST',
        payload: post
    }
}

const setPostUser = (user) => {
    return {
        type: 'POST_USER',
        payload: user
    }
}

const removePost = (action) => {
    return {
        type: 'DELETE_POST',
        payload: action
    }
}

export {
    addUser,
    logout,
    someErorr,
    getAllUsers,
    posts,
    setPost,
    setPostUser,
    loaded
}
